import React from "react";
import PageContent from "../components/PageContent";

const ErrorPage = () => {
  let title = "An Error Ocurred";
  return (
    <PageContent title={title}>
      <p>Something Went Wrong</p>
    </PageContent>
  );
};

export default ErrorPage;
